def string_xor(a: str, b: str) -> str:
    """ Input are two strings a and b consisting only of 1s and 0s.
    Perform binary XOR on these inputs and return result also as a string.
    >>> string_xor('010', '110')
    '100'
    """
    return "".join(str(int(c1) ^ int(c2)) for c1, c2 in zip(a, b))


def single_bit_xor(bs: bytes, k: int) -> bytes:
    """ XOR a single byte (k) with every byte in bs.
    >>> single_bit_xor(bytes([1, 2, 3]), 0xFF)
    b'\xfe\xfd\xfc'
    """
    return bytes(b ^ k for b in bs)


def xor_hex(hex_a: str, hex_b: str) -> str:
    """ XOR two hex strings together.
    >>> xor_hex('1c0111001f010100061a024b53535009181c', '686974207468652062756c6c277320657965')
    '746865206b696420646f6e277420706c6179'
    """
    return "".join(
        f"{int(c1, 16) ^ int(c2, 16):02x}"
        for c1, c2 in zip(hex_a, hex_b)
    )


