    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}

    """
    if not test:
        return {}
    else:
        test = test.split()
        test = dict(Counter(test))
        max_value = max(test.values())
        return {key: value for key, value in test.items() if value == max_value}


